                scale: 0.7,
                filter: "blur(10px)",
                stagger: .1
            })
        },
        rout(event) {
            // console.log(`clicked ${event.target.id}`)
            console.log(event.currentTarget.id)
            this.$router.push(`/${event.currentTarget.id}`)
        }
    }
}

